


<!doctype html>
<html>
    <head>
        <meta charset="utf-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <title>Untitled</title>
        <style>
            body {
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                margin: 0;
                padding: 0;
                overflow: hidden;
                white-space: normal;
            }

            svg {
                display: none;
            }

            .sozi-frame-list {
                position: absolute;
                top: 0;
                right: 0;
                width: 33%;
                height: 100%;
                margin: 0;
                padding: 0.5em 1em 0.5em 0.25em;
                overflow-y: auto;

                font-family: "Droid Sans", Helvetica, Arial, sans-serif;
                font-size: 12pt;

                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);
            }

            .sozi-frame-list ol {
                margin: 0;
                overflow-x: hidden;
            }

            .sozi-frame-list li {
                white-space: nowrap;
            }

            li.sozi-title-level-1:before { content: '. . ';             color: rgb(100, 100, 100); }
            li.sozi-title-level-2:before { content: '. . . . ';         color: rgb(100, 100, 100); }
            li.sozi-title-level-3:before { content: '. . . . . . ';     color: rgb(100, 100, 100); }
            li.sozi-title-level-4:before { content: '. . . . . . . . '; color: rgb(100, 100, 100); }

            .sozi-frame-list a {
                color: inherit;
                text-decoration: none;
            }

            .sozi-frame-list a:hover {
                color: rgb(0, 204, 255);
                text-decoration: underline;
            }

            .sozi-frame-list a.current {
                color: rgb(255, 170, 68);
            }

            .sozi-frame-number {
                position: absolute;
                top: 0;
                left: 1em;
                text-align: center;
                padding: 0.3em 0.6em;

                cursor: pointer;

                font-family: "Droid Sans", Helvetica, Arial, sans-serif;
                font-size: 12pt;
                color: rgb(240, 255, 255);
                background-color: rgba(34, 34, 34, 0.9);
            }

            .sozi-blank-screen {
                background: black;
                position: absolute;
                top: 0;
                left: 0;
                width: 100%;
                height: 100%;
                opacity: 100%;
                visibility: visible;
                z-index: 999;
                transition: opacity 0.5s, visibility 0.5s;
            }

            svg a {
                cursor: pointer;
            }

            @keyframes spinner {
                to { transform: rotate(360deg); }
            }

            .spinner:before {
                content: '';
                box-sizing: border-box;
                position: absolute;
                top: 50%;
                left: 50%;
                width: 40px;
                height: 40px;
                margin-top: -20px;
                margin-left: -20px;
                border-radius: 50%;
                border: 4px solid #ccc;
                border-top-color: #333;
                animation: spinner .8s linear infinite;
            }

HTML*********************************
*************************************

Link the style sheet to the html file 
in the head tag as in the sample below.

<!doctype html>
<html>
  <head>
    <link href="styles.css" rel="stylesheet" />
  </head>
</html>
*/


/************************************
 APPLY FONT FAMILY TO BODY***********
*************************************

replace FONTNAME with your font name. 
Use "" if there are spaces

body { font-family: FONTNAME, "FONT NAME"; }
*/

body { 
    font-family: 
    "Rounded Mplus 1c", 
    "Rounded Mplus 1c Heavy", 
    "Spicy Rice"; 
}


/************************************
LINK THE FONT************************
*************************************

Change .eot to the correct format type and change FILENAME.

@font-face { 
    font-family: "FONT NAME"; 
    src: url('FILENAME.eot') 
    format('embedded-opentype'), <= .oet
    format('woff'),              <= .woff
    format('woff2'),             <= .woff2
    format('truetype');          <= .ttf
}
*/

@font-face { 
    font-family: "Rounded Mplus 1c"; 
    src: url('MPLUSRounded1c-Regular.ttf')
    format('truetype');
}
@font-face { 
    font-family: "Rounded Mplus 1c Heavy"; 
    src: url('MPLUSRounded1c-ExtraBold.ttf') 
    format('truetype');
    font-weight: bold;
}
@font-face { 
    font-family: "Spicy Rice"; 
    src: url('SpicyRice-Regular.ttf') 
    format('truetype');
}





        </style>

    <text xml:space="preserve" style="font-style:normal;font-variant:normal;font-weight:normal;font-stretch:normal;font-size:10.5833px;line-height:1.25;font-family:'Rounded Mplus 1c';-inkscape-font-specification:'Rounded Mplus 1c';white-space:pre;shape-inside:url(#rect277935);display:inline;fill:#000000;fill-opacity:1;stroke:none;stroke-width:0.264583" x="122.78289" y="-16.538387" id="text292229-1"><tspan x="18.191406" y="32.521367" id="tspan9936"><tspan style="font-weight:bold" id="tspan9932">ACTION / I FEEL:</tspan><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9934"> Unless disabled, we all make assessments; which answer </tspan></tspan><tspan x="18.191406" y="47.955365" id="tspan9940"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9938">the question of how we feel about anything. All assessment is made by </tspan></tspan><tspan x="18.191406" y="63.389364" id="tspan9944"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9942">crossing preference with conscience and results in a point on a scale of accept </tspan></tspan><tspan x="18.191406" y="78.823362" id="tspan9948"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9946">- indifferent - reject.
</tspan></tspan><tspan x="18.191406" y="94.25736" id="tspan9952"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9950">
</tspan></tspan><tspan x="18.191406" y="109.69136" id="tspan9958"><tspan style="font-weight:bold" id="tspan9954">SPACE / THE HEART: </tspan><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9956">The assessment of how we feel is only able to bring a verdict </tspan></tspan><tspan x="18.191406" y="125.12536" id="tspan9962"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9960">to values, topics, subjects and matters of concern which have been apperceived </tspan></tspan><tspan x="18.191406" y="140.55936" id="tspan9966"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9964">into our heart (endopathic space).
</tspan></tspan><tspan x="18.191406" y="155.99337" id="tspan9970"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9968">
</tspan></tspan><tspan x="18.191406" y="171.42737" id="tspan9976"><tspan style="font-weight:bold" id="tspan9972">APPERCEPTION / FEELINGS:</tspan> <tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9974">Making assessment produces materials called </tspan></tspan><tspan x="18.191406" y="186.86138" id="tspan9980"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9978">feelings which are merely verdicts (points on the scale of accept - </tspan></tspan><tspan x="18.191406" y="202.29538" id="tspan9984"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan9982">indifferent - reject).</tspan></tspan></text>

</tspan></tspan><tspan x="9.0566406" y="67.563604" id="tspan10050"><tspan style="font-weight:bold" id="tspan10046">SPACE / NOUMENAL WORLD: </tspan><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan10048">The conceptual perceptions are only able to perceive </tspan></tspan><tspan x="9.0566406" y="82.997602" id="tspan10056"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan10052">noumenal objects and experiences which hold space in the nomenal world </tspan><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan10054">(scenarios, </tspan></tspan><tspan x="9.0566406" y="98.4316" id="tspan10062"><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan10058">representations, visions, imaginations, fantasies, transcendant </tspan><tspan style="font-size:12.3472px;baseline-shift:baseline;opacity:1;vector-effect:none;stop-color:#000000;stop-opacity:1" id="tspan10060">symbols, etc ).
</tspan></tspan><tspan x="9.0566406" y="112.12816" id="tspan10066"><tspan style="font-weight:bold" id="tspan10064">
